import React from 'react';
import {Provider}from 'react-redux'
import logo from './logo.svg';
import './App.css';
import ReduxTest from './components/ReduxTest';
import store from './store';

function App() {
  return (
    <div className="App">
      <Provider store={store}>
         <ReduxTest/>
      </Provider>
    </div>
  );
}

export default App;
